import styled from 'styled-components'

const Inner = styled.footer`
    border: 2px solid blue;

    height: 100%; 
    width: 100%;
    margin:auto;

    ul {
        text-align: center;
        padding: 5px;
    }

    li {
        margin: 1.5 em;   
        display: inline;
    }

    a {
        font-size: 30px;
    }
`
export default Inner
